'use strict';

var isEmptyObject = require( './../lib' );

console.log( isEmptyObject( {} ) );
// => true

console.log( isEmptyObject( new Object() ) );
// => true

console.log( isEmptyObject( { 'beep': 'boop' } ) );
// => false

console.log( isEmptyObject( [] ) );
// => false
